import { ADD_LIST, CHANGE_LIST_NUM, CHANGE_BOOL } from './action-type'

export default {
    addList(params) {
        return {
            type: ADD_LIST,
            params: params
        }
    },
    changeNum(params) {
        return (dispatch) => {
            setTimeout(() => {
                let action = {
                    type: CHANGE_LIST_NUM,
                    params: params
                }
                dispatch(action)
            }, 1000)
        }
        // console.log(params)
        // return {
        //     type: CHANGE_LIST_NUM,
        //     params: params
        // }
    },
    changebool(params) {
        return {
            type: CHANGE_BOOL,
            params: params
        }
    }
}
